// 官方解法二：单调栈+常数优化
class Solution {
public:
    int largestRectangleArea(vector<int>& heights) {
        int n = heights.size();
        vector<int> left(n), right(n, n);
        stack<int> mono;

        for (int i = 0; i < n; ++i) {
            while (!mono.empty() && heights[mono.top()] >= heights[i]) {
                right[mono.top()] = i;
                mono.pop();
            }
            left[i] = mono.empty() ? -1 : mono.top();
            mono.push(i);
        }

        int maxArea = 0;
        for (int i = 0; i < n; ++i) {
            maxArea = max(maxArea, (right[i] - left[i] - 1) * heights[i]);
        }
        return maxArea;
    }
};


